import './App.css';
import Home from './screen/Home';
import ogin from './screen/Login';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  // Link
} from "react-router-dom";



function App() {
  return (
      <Router>
        <div>
          <Routes>
            <Route exact path='/' element={<Home/>}></Route>
            <Route exact path='/login' element={<Login/>}></Route>
          </Routes>
        </div>
      </Router>
  );
}

export default App;
